import React, { Component } from 'react';
import usericon from '../img/nav-usericon.png';

class Navbar extends Component {

    state = { 
        logo : usericon,
        usericon :"",
        username : "",
        mail : ""
    }

    render() { 
        return (
            <div className="nav">
                <div className="logo">
                    <img src="{}" alt="" className="nav-logo" />
                </div>
                <div className="user-details">

                </div>
            </div>
        );
    }

}

export default Navbar;
